import React from 'react'

function CallBackButton({value , handleClick , children}) {
  console.log(`Render ${children} Button`);
  return (
    <>
    <p>{value}</p>
    <button onClick={handleClick}>{children}</button>
    </>
  )
}

export default CallBackButton
